import { createMuiTheme } from '@material-ui/core/styles';
import PostNoBills from './static/post-no-bills/postnobillscolombo-regular.ttf';

const postnobills = {
  fontFamily: 'Colombo',
  fontStyle: 'normal',
  fontDisplay: 'swap',
  fontWeight: 400,
  src: `
    local('Colombo'),
    local('postnobillscolombo-regular),
    url(${PostNoBills}) format('ttf')
    `,
    unicodeRange:
    'U+0000-00FF, U+0131, U+0152-0153, U+02BB-02BC, U+02C6, U+02DA, U+02DC, U+2000-206F, U+2074, U+20AC, U+2122, U+2191, U+2193, U+2212, U+2215, U+FEFF',
};

const theme = createMuiTheme({
  typography: {
    fontFamily: 'Colombo',
  },
  overrides: {
    MuiCssBaseline: {
      '@global': {
        '@font-face': [postnobills],
      },
    },
  },
});

export default theme
